import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./Components/Home";
import { About } from "./Components/About";
import { Services } from "./Components/Services";






const App = () => {

  return (
    <Router>
      <div>
        <nav className="fixed font-popins top-0 left-0 right-0 px-10 py-5 flex items-center justify-evenly w-full bg-light-yellow drop-shadow-md z-[5000]">
          <Link to="/" className="text-[1.2rem] font-lg">Hanzee Construction</Link>
          <ul className="flex gap-10 font-md items-center">
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/services">Stocks</Link>
            </li>
            <li>
              <Link to="/about">Stocks</Link>
            </li>
          </ul>




        </nav>

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/customer" element={<Customer />} />
          <Route path="/login" element={<LoginPage />} />


        </Routes>
      </div>
    </Router>
  );
};

export default App;
